import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

// import About from './about';
// import Blog from './blog';
// import Blogs from './blogging';
// import Ceremony from './ceremony';
// import Counter from './counter';
// import Events from './events';
// import Footer from './footer';
// import HeroVideo from './heroVideo';
// import LogoCarousel from './logocarousel';
// import Nav2 from './nav2';
// import Navbar from './navbar';
import Sponsership from './sponsership';
// import StarSpeaks from './starSpeaks';
// import UpcomingEvents from './upcoming_events';
import WinnersGallery from './winnersgallery';
import Home from './home'
import AboutUS from "./about2";
import Blog2 from "./blog2";
import Contact from "./contact";
import ReadMore from "./readMore";
import ReadMore2 from "./readMore2";
import ReadMore3 from "./readmore3";
import ReadMore4 from "./readmore4";
// import Login from "./login";
// import Admin from "./admin/admin";


function App() {
  return (

    <Router>
      <div className="App">
        {/* <Navbar />
        <Nav2 />
        <HeroVideo />
        <Counter />
        <About />
        <Events />
        <Ceremony />
        <StarSpeaks />
        <LogoCarousel />
        <Blogs />
        <UpcomingEvents />
        <Blog />
        <Footer /> */}

        <Routes>
          <Route path="/" element={<Home />} />
          {/* <Route path="/admin" element={<Admin />} /> */}
          <Route path="/winnersgallery" element={<WinnersGallery />} />
          <Route path="/sponsership" element={<Sponsership />} />
          <Route path="/about2" element={<AboutUS />} />
          <Route path="/blog2" element={<Blog2 />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/readmore/:id" element={<ReadMore />} />
          <Route path="/readmore2" element={<ReadMore2 />} />
          <Route path="/readmore3" element={<ReadMore3 />} />
          <Route path="/readmore4" element={<ReadMore4 />} />
          {/* <Route path="/login" element={<Login />} /> */}
        </Routes>


      </div>
    </Router>

  );
}


export default App;
